import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BuildingTable = () => {
  const [buildings, setBuildings] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('/api/buildings');
      setBuildings(result.data);
    };
    fetchData();
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>City</th>
          <th>Neighborhood</th>
          <th>Hosts</th>
          <th>Created At</th>
        </tr>
      </thead>
      <tbody>
        {buildings.map(building => (
          <tr key={building._id}>
            <td>{building.name}</td>
            <td>{building.city.name}</td>
            <td>{building.neighborhood}</td>
            <td>
              {building.hosts.map((host, index) => (
                <div key={index}>
                  <p>Name: {host.name}</p>
                  <p>Contact No: {host.contactNo}</p>
                  <p>Status: {host.status}</p>
                </div>
              ))}
            </td>
            <td>{building.createdAt}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default BuildingTable;
